import { useEffect, useState } from "react";

const Home = () => {
  const [workouts, setWorkouts] = useState([]);

  useEffect(() => {
    const fetchWorkouts = async () => {
      const res = await fetch("http://localhost:4000/api/workouts");
      const data = await res.json();
      if (res.ok) {
        setWorkouts(data);
      } else {
        console.log(data.message);
      }
    };
    fetchWorkouts();
  }, []);

  return (
    <div className="home">
      <h2>Home</h2>
    </div>
  );
};

export default Home;
